import './Profile.css';
import logomain from '../files/logo_main.bmp';
import {React, useState} from 'react';

export const Profile = () => {
  //const [projects, setProjects] = useState([]);

  return (
    <div className="body">

      <div className="nav">
        <img className='logomain' src={logomain} alt='Logo'/>
        <h1>Find-a-Bull-Market</h1>
        <div className='profile'>
          <ProfilePicture />
        </div>
      </div>

      <div className="content">
        <SearchBar />
        <div className="projects">
            {/*projects.map((item) => {
              return (
                <div class = "item">
                  <ProjectTile project={item}/>
                </div>
              )
            })*/}
          <div className = "item">
            <ProjectTile/>
          </div> 
          <div className = "item">
            <ProjectTile/>
          </div> 
          <div className = "item">
            <ProjectTile/>
          </div> 
          
        </div>
      </div>
      <div className='new-project'>
            <NewProject />
      </div>
    </div>
  );
}
